import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Perform a search to display the sort/filter controls which include the view toggle
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.locator('#searchInput').fill('electronics');
    await page.locator('.search-btn').first().click();

    // Wait for search results to load and take a screenshot of the default grid view
    await page.waitForSelector('.products-grid', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_grid_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_grid_view.png'));

    // Locate and click the "List View" button
    const listViewButton = page.locator('button[title="List View"]');
    await listViewButton.waitFor({ state: 'visible', timeout: 5000 });
    await listViewButton.click();

    // Wait for the product container to switch to list view mode
    await page.waitForSelector('.products-list', { timeout: 5000 });

    // Take a screenshot after switching to list view
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_list_view.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_list_view.png'));

    // Extract data to verify the switch
    const isListViewActive = await listViewButton.evaluate(node => node.classList.contains('active'));
    const productListVisible = await page.locator('.products-list').isVisible();

    return {
      success: true,
      action: "Switched product view from grid to list mode.",
      extractedData: {
        isListViewButtonActive: isListViewActive,
        isProductListContainerVisible: productListVisible
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
